    playbackData.comments = {"ev-0":[{"id":"commentId-0","displayCommentEvent":{"id":"ev-0","timestamp":1646597106323,"createdByDevGroupId":"devGroupId-1","eventSequenceNumber":0,"permanentRelevance":"never relevant","type":"CREATE DIRECTORY","directoryId":"dirId-0","directoryPath":"/","parentDirectoryId":null},"developerGroupId":"devGroupId-1","timestamp":1646597199420,"commentText":"This playbacks describes how tables are combined in a <font face=\"Courier\">FROM</font> clause.<br>","selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"0","currentFilePath":"","viewableBlogText":"","commentTags":[],"questionCommentData":null,"commentTitle":""}],"ev-20":[{"id":"commentId-1","displayCommentEvent":{"id":"ev-20","timestamp":1646597143965,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":20,"type":"INSERT","fileId":"fileId-0","character":";","previousNeighborId":"ev-19","lineNumber":2,"column":10,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1646598146447,"commentText":"This query shows the 17 dogs that are currently in the database (see the attached screenshot).<br>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"Dogs","startRow":1,"startColumn":5,"endRow":1,"endColumn":9}],"imageURLs":["media/images/1646597231465-Screen Shot 2022-03-06 at 2.01.40 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"1","linesBelow":"0","currentFilePath":"/from.sql","viewableBlogText":"SELECT *\nFROM Dogs;","commentTags":["image"],"questionCommentData":null,"commentTitle":""}],"ev-34":[{"id":"commentId-2","displayCommentEvent":{"id":"ev-34","timestamp":1646597160057,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":34,"type":"INSERT","fileId":"fileId-0","character":"s","previousNeighborId":"ev-33","lineNumber":2,"column":14,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1646598155496,"commentText":"This query shows the three locations that are in the database (see the attached screenshot).<br>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"Locations","startRow":1,"startColumn":5,"endRow":1,"endColumn":14}],"imageURLs":["media/images/1646597299118-Screen Shot 2022-03-06 at 2.02.02 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"1","linesBelow":"1","currentFilePath":"/from.sql","viewableBlogText":"SELECT *\nFROM Locations;\n","commentTags":["image"],"questionCommentData":null,"commentTitle":""}],"ev-40":[{"id":"commentId-3","displayCommentEvent":{"id":"ev-40","timestamp":1646597167973,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":40,"type":"INSERT","fileId":"fileId-0","character":" ","previousNeighborId":"ev-39","lineNumber":2,"column":11,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1646598083030,"commentText":"<div>When more than one table is listed in a <font face=\"Courier\">FROM</font> clause then a cross-product, also known as a Cartesian product, is created. <br></div><div><br></div><div>A cross-product is every combination of rows from two or more tables. The attached picture shows the cross product of a 3X3 table and a 2X4 table. The resulting table is 6X7.</div><div><br></div><div>The attached screenshots show the results with the Dogs and Locations tables. In the first screenshot you can see that the first three rows are combinations of the first row in the Dogs table (with the dog \"Patches\") with the three rows in the Locations table. In the second screenshot you can see that there are 51 total rows (3 * 17 = 51).<br></div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"Dogs","startRow":1,"startColumn":5,"endRow":1,"endColumn":9},{"fileId":"fileId-0","selectedText":"Locations","startRow":1,"startColumn":11,"endRow":1,"endColumn":20}],"imageURLs":["media/images/1646597565105-image.png","media/images/1646597866976-Screen Shot 2022-03-06 at 2.02.58 PM.png","media/images/1646597866976-Screen Shot 2022-03-06 at 2.03.39 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"1","linesBelow":"1","currentFilePath":"/from.sql","viewableBlogText":"SELECT *\nFROM Dogs, Locations;\n","commentTags":["image"],"questionCommentData":null,"commentTitle":""}],"ev-106":[{"id":"commentId-4","displayCommentEvent":{"id":"ev-106","timestamp":1646598218719,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":106,"type":"INSERT","fileId":"fileId-0","character":"d","previousNeighborId":"ev-105","lineNumber":2,"column":64,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1646672245887,"commentText":"<div>The cross-product is only useful if I can intelligently make use of all of those combinations of rows. <font face=\"Courier\">INNER JOIN</font> allows me to specify how the rows in the two (or more) tables should be filtered. I will look for rows where a foreign key matches a primary key.<br></div><div><br></div><div>I specify the two tables with <font face=\"Courier\">INNER JOIN</font>. In this case, I am saying I want a cross-product between the Dogs and Locations tables. Then I use <font face=\"Courier\">ON</font> to tell the DBMS which rows to retrieve. I specify which foreign key/primary key to match. <br></div><div><br></div><div>The DBMS will go through each row of the cross-product and only return the ones where a dog's <font face=\"Courier\">locationId</font> matches a location's <font face=\"Courier\">id</font>.</div><div><br></div><div>The attached screenshot shows the 17 dogs and their locations. The extra rows from the cross-product were removed since they did not have a match in foreign key to primary key.</div><div><br></div><div>Note: in the next playback I will show another way to join tables together on primary key/foreign key using <font face=\"Courier\">WHERE</font>.<br></div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"Dogs INNER JOIN Locations ON Dogs.locationId = Locations.id","startRow":1,"startColumn":5,"endRow":1,"endColumn":64}],"imageURLs":["media/images/1646599555382-Screen Shot 2022-03-06 at 2.44.24 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"1","linesBelow":"1","currentFilePath":"/from.sql","viewableBlogText":"SELECT *\nFROM Dogs INNER JOIN Locations ON Dogs.locationId = Locations.id;\n","commentTags":["image"],"questionCommentData":null,"commentTitle":""}],"ev-155":[{"id":"commentId-5","displayCommentEvent":{"id":"ev-155","timestamp":1646599669149,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":155,"type":"INSERT","fileId":"fileId-0","character":"e","previousNeighborId":"ev-154","lineNumber":1,"column":55,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1646605445705,"commentText":"<div>You can use projection to select which columns to display in the results (see the attached screenshot).<br></div><div><br></div><div>Sometimes two separate tables will have attributes with the same names. In this case both the Dogs and Locations tables have an attribute called <font face=\"Courier\">name</font>.<br></div><div><br></div><div>In order to be clear about which attributes to display in the results you can precede the name of the attribute with the name of the table and a dot:<br><br><font face=\"Courier\">TableName.attributeName</font></div><div><br></div><div>I usually do this every time there are multiple tables in a query whether it is strictly needed or not.</div><div><br></div><div>Note: I could have used the <font face=\"Courier\">AS</font> keyword to rename the location's name to <font face=\"Courier\">locationName</font> or something like that.<br></div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"Dogs.id, Dogs.name, Locations.id, Locations.name","startRow":0,"startColumn":7,"endRow":0,"endColumn":55}],"imageURLs":["media/images/1646599947820-Screen Shot 2022-03-06 at 2.47.32 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"2","currentFilePath":"/from.sql","viewableBlogText":"SELECT Dogs.id, Dogs.name, Locations.id, Locations.name\nFROM Dogs INNER JOIN Locations ON Dogs.locationId = Locations.id;\n","commentTags":["image"],"questionCommentData":null,"commentTitle":""}],"ev-333":[{"id":"commentId-6","displayCommentEvent":{"id":"ev-333","timestamp":1646601160924,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":333,"type":"INSERT","fileId":"fileId-0","character":"NEWLINE","previousNeighborId":"ev-332","lineNumber":2,"column":47,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1646601880057,"commentText":"<div>The previous query only focused on one relationship, the one-to-many between a dog and its location.</div><div><br></div><div>There are two other relationships in this database, however. There is a one-to-many between the client who adopts a dog and a many-to-many between the clients who visit dogs.</div><div><br></div><div>I can add all of the tables in a single query by listing all of the tables in the <font face=\"Courier\">FROM</font> clause. The attached screenshot shows the result when I execute this query. There are a lot of rows!</div><div><br></div><div>There are 17,136 because this is a cross-product of all of the tables.<br>Clients: 14 rows, 4 attributes<br></div><div>ClientMeetsDog: 24 rows, 3 attributes<br></div><div>Dogs: 17 rows, 9 attributes<br></div><div>Locations: 3 rows, 7 attributes<br></div><div><br></div><div>#rows = 14 * 24 * 17 * 3 = 17,136</div><div><br></div><div>There are 23 attributes in the results but they are not all visible in the screenshot.&nbsp;</div><div><br></div><div>#attributes = 4 + 3 + 9 + 7 = 23<br></div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"Clients, ClientMeetsDog, Dogs, Locations","startRow":1,"startColumn":5,"endRow":1,"endColumn":45}],"imageURLs":["media/images/1646601418793-Screen Shot 2022-03-06 at 3.13.01 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"1","linesBelow":"1","currentFilePath":"/from.sql","viewableBlogText":"SELECT *\nFROM Clients, ClientMeetsDog, Dogs, Locations;\n","commentTags":["image"],"questionCommentData":null,"commentTitle":""}],"ev-467":[{"id":"commentId-7","displayCommentEvent":{"id":"ev-467","timestamp":1646602216364,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":467,"type":"INSERT","fileId":"fileId-0","character":"NEWLINE","previousNeighborId":"ev-466","lineNumber":2,"column":69,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1646605576427,"commentText":"<div>In this query I will focus on the relationship between a client and a dog that gets adopted (see the attached segment of the ER Diagram).</div><div><br></div><div>I will <font face=\"Courier\">INNER JOIN</font> the Clients and Dogs tables and filter <font face=\"Courier\">ON</font> the primary key/foreign key matches that indicate the 'adopts' relationship.<br><br>The attached screenshots show the Clients and Dogs tables and the results of the query. There are exactly eight dogs with a non-null <font face=\"Courier\">adoptedByClientId</font> foreign key value. This query retrieves those eight dogs and the clients who adopted them.<br></div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"Clients INNER JOIN Dogs ON Clients.id = Dogs.adoptedByClientId","startRow":1,"startColumn":5,"endRow":1,"endColumn":67}],"imageURLs":["media/images/1646602612919-IMG_4986FB89305B-1.jpeg","media/images/1646604807622-Screen Shot 2022-03-06 at 4.12.07 PM.png","media/images/1646604807622-Screen Shot 2022-03-06 at 4.12.39 PM.png","media/images/1646602236706-Screen Shot 2022-03-06 at 3.29.39 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"1","linesBelow":"1","currentFilePath":"/from.sql","viewableBlogText":"SELECT *\nFROM Clients INNER JOIN Dogs ON Clients.id = Dogs.adoptedByClientId;\n","commentTags":["image"],"questionCommentData":null,"commentTitle":""}],"ev-534":[{"id":"commentId-8","displayCommentEvent":{"id":"ev-534","timestamp":1646602447544,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":534,"type":"INSERT","fileId":"fileId-0","character":"e","previousNeighborId":"ev-533","lineNumber":1,"column":73,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1646602881804,"commentText":"Here I project out a smaller set of attributes. It is not uncommon for a query to evolve over time. I often start small and then add more and more detail to the query until it achieves my goals.<br>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"Clients.firstName, Clients.lastName, Dogs.name, Dogs.adoptedOnDate","startRow":0,"startColumn":7,"endRow":0,"endColumn":73}],"imageURLs":["media/images/1646602497237-Screen Shot 2022-03-06 at 3.34.38 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"2","currentFilePath":"/from.sql","viewableBlogText":"SELECT Clients.firstName, Clients.lastName, Dogs.name, Dogs.adoptedOnDate\nFROM Clients INNER JOIN Dogs ON Clients.id = Dogs.adoptedByClientId;\n","commentTags":["image"],"questionCommentData":null,"commentTitle":""}],"ev-817":[{"id":"commentId-9","displayCommentEvent":{"id":"ev-817","timestamp":1646603071092,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":817,"type":"INSERT","fileId":"fileId-0","character":";","previousNeighborId":"ev-816","lineNumber":3,"column":50,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1646672440272,"commentText":"<div>Next, I'll focus on the 'client meets dog' many-to-many relationship. Recall that there is a join table that links the clients and dogs. The join table records the id of a client and the id of a dog when they meet.</div><div><br></div><div>In the <font face=\"Courier\">FROM</font> clause I'll specify the connection between the Clients and ClientMeetsDog tables.</div><div><br></div><div>The attached snippet of the ER Diagram shows the many-to-many relationship and the attached screenshots show the data in the three tables.<br></div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"Clients INNER JOIN ClientMeetsDog ON Clients.id = ClientMeetsDog.clientId ","startRow":1,"startColumn":5,"endRow":1,"endColumn":79}],"imageURLs":["media/images/1646603324772-IMG_0E6F20E5CD5A-1.jpeg","media/images/1646604807622-Screen Shot 2022-03-06 at 4.12.07 PM.png","media/images/1646604807622-Screen Shot 2022-03-06 at 4.12.20 PM.png","media/images/1646604807622-Screen Shot 2022-03-06 at 4.12.39 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"1","linesBelow":"1","currentFilePath":"/from.sql","viewableBlogText":"SELECT *\nFROM Clients INNER JOIN ClientMeetsDog ON Clients.id = ClientMeetsDog.clientId  \nINNER JOIN Dogs ON Dogs.id = ClientMeetsDog.dogId;","commentTags":["image"],"questionCommentData":null,"commentTitle":""},{"id":"commentId-10","displayCommentEvent":{"id":"ev-817","timestamp":1646603071092,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":817,"type":"INSERT","fileId":"fileId-0","character":";","previousNeighborId":"ev-816","lineNumber":3,"column":50,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1646605814038,"commentText":"<div>Because there is another table involved, Dogs, I'll have to take the results and <font face=\"Courier\">INNER JOIN</font> them with the Dogs table on the primary key/foreign key that links the dogs to the meetings.</div><div><br></div><div>The attached screenshot shows the 24 rows representing each meeting between a client and a dog.<br></div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"INNER JOIN Dogs ON Dogs.id = ClientMeetsDog.dogId","startRow":2,"startColumn":0,"endRow":2,"endColumn":49}],"imageURLs":["media/images/1646603598247-Screen Shot 2022-03-06 at 3.44.55 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"2","linesBelow":"0","currentFilePath":"/from.sql","viewableBlogText":"SELECT *\nFROM Clients INNER JOIN ClientMeetsDog ON Clients.id = ClientMeetsDog.clientId  \nINNER JOIN Dogs ON Dogs.id = ClientMeetsDog.dogId;","commentTags":["image"],"questionCommentData":null,"commentTitle":""}],"ev-890":[{"id":"commentId-11","displayCommentEvent":{"id":"ev-890","timestamp":1646603115170,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":890,"type":"INSERT","fileId":"fileId-0","character":"e","previousNeighborId":"ev-889","lineNumber":1,"column":79,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1646603674739,"commentText":"Next, I limit the attributes to display.<br>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"Clients.firstName, Clients.lastName, Dogs.name, ClientMeetsDog.visitDate","startRow":0,"startColumn":7,"endRow":0,"endColumn":79}],"imageURLs":["media/images/1646603666129-Screen Shot 2022-03-06 at 3.45.44 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"2","currentFilePath":"/from.sql","viewableBlogText":"SELECT Clients.firstName, Clients.lastName, Dogs.name, ClientMeetsDog.visitDate\nFROM Clients INNER JOIN ClientMeetsDog ON Clients.id = ClientMeetsDog.clientId  \nINNER JOIN Dogs ON Dogs.id = ClientMeetsDog.dogId;","commentTags":["image"],"questionCommentData":null,"commentTitle":""}],"ev-963":[{"id":"commentId-12","displayCommentEvent":{"id":"ev-963","timestamp":1646603173113,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":963,"type":"INSERT","fileId":"fileId-0","character":"e","previousNeighborId":"ev-962","lineNumber":1,"column":95,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1646605861146,"commentText":"<div>Finally, I want to display the locations where the meetings took place. This is always the location that the dog is housed in.</div><div><br></div><div>So, I need to extend the query with another <font face=\"Courier\">INNER JOIN</font>, this time with the Locations table linking on the dog's <font face=\"Courier\">locationId</font>.<br></div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"INNER JOIN Locations ON Dogs.locationId = Locations.id","startRow":3,"startColumn":0,"endRow":3,"endColumn":54}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"3","linesBelow":"0","currentFilePath":"/from.sql","viewableBlogText":"SELECT Clients.firstName, Clients.lastName, Dogs.name, ClientMeetsDog.visitDate, Locations.name\nFROM Clients INNER JOIN ClientMeetsDog ON Clients.id = ClientMeetsDog.clientId  \nINNER JOIN Dogs ON Dogs.id = ClientMeetsDog.dogId\nINNER JOIN Locations ON Dogs.locationId = Locations.id;","commentTags":[],"questionCommentData":null,"commentTitle":""},{"id":"commentId-13","displayCommentEvent":{"id":"ev-963","timestamp":1646603173113,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":963,"type":"INSERT","fileId":"fileId-0","character":"e","previousNeighborId":"ev-962","lineNumber":1,"column":95,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1646603911345,"commentText":"Finally, I add the name of the location to the query. Since the Locations table is not part of the <font face=\"Courier\">FROM</font> clause I have access to all of its attributes. The attached screenshot shows the results.<br>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"Locations.name","startRow":0,"startColumn":81,"endRow":0,"endColumn":95}],"imageURLs":["media/images/1646603856935-Screen Shot 2022-03-06 at 3.46.35 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"3","currentFilePath":"/from.sql","viewableBlogText":"SELECT Clients.firstName, Clients.lastName, Dogs.name, ClientMeetsDog.visitDate, Locations.name\nFROM Clients INNER JOIN ClientMeetsDog ON Clients.id = ClientMeetsDog.clientId  \nINNER JOIN Dogs ON Dogs.id = ClientMeetsDog.dogId\nINNER JOIN Locations ON Dogs.locationId = Locations.id;","commentTags":["image"],"questionCommentData":null,"commentTitle":""}],"ev-1322":[{"id":"commentId-14","displayCommentEvent":{"id":"ev-1322","timestamp":1646604098930,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":1322,"type":"INSERT","fileId":"fileId-0","character":"NEWLINE","previousNeighborId":"ev-1321","lineNumber":2,"column":68,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1646606080285,"commentText":"<div>Not every client adopts a dog, of course. The last query filtered out any client that did NOT adopt a dog. What if you'd like to see all of the clients information and, if they adopted a dog, information about the dogs?</div><div><br></div><div>A <font face=\"Courier\">LEFT JOIN</font> will display a resulting row for all of the rows in the table on the left (Clients in this case) and, if there is a match between a primary key/foreign key with the table on the right (in this case Dogs), then that information will be added to the row.</div><div><br></div><div>The attached screenshot shows the difference between an <font face=\"Courier\">INNER JOIN</font> and a <font face=\"Courier\">LEFT JOIN</font>. <br></div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"Clients LEFT JOIN Dogs","startRow":1,"startColumn":5,"endRow":1,"endColumn":27}],"imageURLs":["media/images/1646604531573-Screen Shot 2022-03-06 at 4.07.47 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"1","linesBelow":"1","currentFilePath":"/from.sql","viewableBlogText":"SELECT *\nFROM Clients LEFT JOIN Dogs ON Clients.id = Dogs.adoptedByClientId;\n","commentTags":["image"],"questionCommentData":null,"commentTitle":""}]};
